import React, { useState } from 'react'
import Head from 'next/head'



const Home: React.FC = () => {

  const [inputIP, setInputIP] = useState('')

  function handleInput(text) {
    alert(text)
  }

  return (
    <div className="container">
      <Head>
        <title>Primefox - Get Range IP</title>
      </Head>

      <div className="card">
        <h3>Buscar . . .</h3>
        <input type="text" placeholder="Digite Host ou IP" onChange={e => setInputIP(e.target.value)} />
        <button type="submit" onClick={(e) => handleInput(e.clientX)}>Get Range</button>
      </div>

      <div className="bottom">
        <a href="http://primefox.com.br">Primefox</a>
      </div>

    </div>
  )
}

export default Home;
